import axios from "axios";
import React, { useEffect, useState } from "react";
import { Table } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import universitiesSlice, {
  getUniversitiesAsync,
  selectUniversities,
  setUniversitiesByCountryName,
} from "../redux/universities/universitiesSlice";
import UniversityService from "../service/UniversityService";

export default function ListPage() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getUniversitiesAsync());
  }, []);

  const universities = useSelector((state) => state.universities.data);
  console.log("universities");
  console.log(universities);
  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>University Name</th>
            <th>Domain</th>
            <th>Web Page</th>
          </tr>
        </thead>
        <tbody>
          {universities.map(university=>(
            <tr key={universities.indexOf(university)}>
        <td>{universities.indexOf(university)+1}</td>
        <td>{university.name}</td>
        <td>{university.domains[0]}</td>
        <td>
          <a
            style={{ textDecoration: "none" }}
            href={university.web_pages[0]}
            target="_blank"
          >
            {university.web_pages[0]}
          </a>
        </td>
      </tr>
        ))}
        </tbody>
      </Table>
    </div>
  );
}
